		controller.handleOkForManuallyUpdateLicenseCount = function() {
			if (state.requestedNewLicenseCount) {
				controller.handleOkForLicenseCountValueChange();
			}
			if (state.toggledUnlimitedLicenses) {
				controller.handleOkForUnlimitedLicenses();
			}
			controller.updateHeaderMessage();

			$manualLicenseUpdateModal.hide();
		}

		/**
		 * Handles the OK response for manually updating the license count.
		 */
		 controller.handleOkForLicenseCountValueChange = function() {
			var alertMsg;
			var oldLicenseCount = state.totalLicenses;
			var newLicenseCount = state.requestedNewLicenseCount;
			if (newLicenseCount === state.totalLicenses) {
				alertMsg = 'Successfully updated the license count for this customer to ' + newLicenseCount + '.';
			} else {
				alertMsg = 'Successfully updated the license count for this customer from ' + oldLicenseCount + ' to ' + newLicenseCount + '.';
			}

			// Actually update the license count.
			state.totalLicenses = newLicenseCount;

			// Then go increment or decrement the license numbers stored on the client side.
			if (oldLicenseCount > newLicenseCount) {
				controller.updateRemainingLicenses('subtract', oldLicenseCount - newLicenseCount);
			} else {
				controller.updateRemainingLicenses('add', newLicenseCount - oldLicenseCount);
			}

			// Update the value that goes into the header and add the success alert.
			controller.updateTotalLicenses();
			controller.addSuccessAlert(alertMsg);
		}

