/**
 * If given a URL, shows the "Learn More" dialog using the given URL.
 * Otherwise, shows Marketplace teaser information in a lightbox
 *
 * @author Yair Aviner
 *
 */

icims = icims || {};
(function(icims) {

  var learnMore = icims.learnMore = icims.learnMore ||
  function (elem) {

    var utils = {
      removeCallouts: function() {
        if (typeof calloutManager !== 'undefined') {
          calloutManager.removeAllCallouts();
        }
      },
      getLearnMoreModal: function() {
    	var existingModal = $(elem).data("learnMoreModal");
    	if(existingModal) {
    		return existingModal;
    	}

    	var title = $(elem).data("learnMoreTitle");
    	var image = $(elem).data("learnMoreImage");
    	var subtitle = $(elem).data("learnMoreSubtitle");
    	var content = $(elem).data("learnMoreDescription");
        var url = $(elem).data("learnMoreUrl");
        var button = $(elem).data("learnMoreButton");

        var modal = new icims.Modal({
          appendTo: window.document.body,
          content: content
        }, {
          //template vars
          showHeader: true,
          showFooter: true,
          showCloseButton: !url,
          title: title
        }, {
          //bootstrap vars
        });
        if (url) {
          var splitFooter = modal.createSplitFooter();

          $('<div tabindex="0" class="btn btn-primary"></div>')
            .text(button)
            .appendTo(splitFooter.$rightFoot)
            .on('click', function(e) {
				window.open(url);
			})
			.on('keydown', function(event) {
				if (event.keyCode === 13 || event.which === 13 || event.key === 13) {
					window.open(url);
				}
            });
        }
        // Add learn more brand style to modal
        modal.$modal.addClass('learn-more-modal');
        // Add iCIMS logo to top of modal if title is empty
        if(!title) {
        	modal.$logo = $('<div></div>').addClass('modal-logo').prependTo(modal.$header);
        	modal.$header.find('.modal-title').hide();
        }
        // Add custom image into modal
        if(image) {
        	modal.$image = $('<div></div>').addClass('modal-img').css('background-image', 'url(' + image + ')').insertBefore(modal.$body);
        }
        // Add subtitle into modal
        modal.$subtitle = $('<h4></h4>').addClass('modal-subtitle').text(subtitle).insertBefore(modal.$body);

        $(elem).data("learnMoreModal", modal)

        return modal;
      }
    }

    // Close any callouts that might be showing before opening the Lightface.
    utils.removeCallouts();
    var thisModal = utils.getLearnMoreModal();
    thisModal.show();
  }

  return icims;
}(icims || {}));

