function removeTagsByKeyboard(tagsInput, $) {
	// Handle keyboard (keydown) events
	tagsInput.$container.on('keydown', '[data-role=remove]', $.proxy(function (event) {
		if (tagsInput.$element.attr('disabled')) {
			return;
		}
		// Check if the key pressed is either Space (32) or Enter (13)
		if (event.keyCode !== 32 && event.keyCode !== 13) {
			return;
		}
		// Prevent default space scroll behavior
		event.preventDefault();
		tagsInput.remove($(event.target).closest('.tag').data('item'));
	}, tagsInput));
}

// Function to add attributes to the tag elements
function enhanceTagAccessibility(tag) {
	const removeButton = tag.querySelector('[data-role="remove"]');
	if (removeButton) {
		removeButton.setAttribute('role', 'button');
		removeButton.setAttribute('tabindex', '0');
		const itemText = tag.querySelector('.tag-text').textContent;
		removeButton.setAttribute('aria-label', 'Remove ' + itemText);
	}
}

// Create a MutationObserver to observe changes in the DOM
const observer = new MutationObserver(function (mutations) {
	mutations.forEach(function (mutation) {
		mutation.addedNodes.forEach(function (node) {
			if (node.nodeType === 1 && node.matches('.tag')) {
				enhanceTagAccessibility(node);
			}
		});
	});
});
// Start observing the document for changes
observer.observe(document.body, {childList: true, subtree: true});

if (typeof module !== 'undefined' && module.exports) {
	module.exports = {
		removeTagsByKeyboard: removeTagsByKeyboard,
		enhanceTagAccessibility: enhanceTagAccessibility,
		observer : observer
	};
}

