/**
 * iCIMS Products Menu
 *
 * @template {{> com-icims-help-view-marketplace-products-list }}
 * @depends Handlebars
 */
var icims;
(function (icims) {
	if (typeof Handlebars === 'undefined') return;

	var products = function() {
		var productTemplate = Handlebars.templates['com-icims-help-view-marketplace-products-list'];

		function init(options) {
			if (!options.url) {
				console.log('You must include a url.');
				return;
			}
			if (!options.callback && !options.targetElement) {
				console.log('You must include either a callback or targetElement.');
				return;
			}

			getData(options.url)
				.then(handleData(postActions(options.callback, options.click, options.collapsible), options.targetElement))
		}

		function getData(url) {
			return $.ajax(url, {
				dataType : 'json'
			});
		}

		function handleData(callback, targetElement) {
			return function(data) {
				if (data && data.productGroups) {
					var productTemplate = Handlebars.templates['com-icims-help-view-marketplace-products-list'];
					if (productTemplate) {
						$(targetElement).html(productTemplate(data));

						callback(data, productTemplate, targetElement);
					}
				} else {
					console.log('Could not initialize marketplace products: response data invalid');
				}
			};
		}

		function postActions(callback, click, collapsible) {
			return function(data, productTemplate, targetElement) {
				// did you give me a callback?
				if ($.isFunction(callback)) {
					callback(data, productTemplate, targetElement);
				}

				if ($.isFunction(click)) {
					$('[data-marketplace-url]').on('click', function() {
						click($(this).data('marketplace-url'), this, targetElement);
					});
				}

				if (collapsible) {
					initCollapsible(targetElement, collapsible);
				}
			}
		}

		function initCollapsible(targetElement, collapsible) {
			collapsible = $.isPlainObject(collapsible) ? collapsible : {};
			var filter = $.isFunction(collapsible.filter) ? collapsible.filter : function() {return true;};

			var COLLAPSED_CLASS = 'category-collapsed';
			$('.collapsible-category', targetElement).filter(filter).on('click.expand', function() {
				// top item in the category component
				var $category = $(this).closest('[data-category-id]');

				// locate and toggle the category status
				var $statusItem = $category.find('.collapsible-status-item').toggleClass(COLLAPSED_CLASS);

				// slide the products in and out
				var $categoryItems = $category.find('.list-group > .product-group-items').stop(true);
				if ($statusItem.hasClass(COLLAPSED_CLASS)) {
					$categoryItems.slideUp();
				} else {
					$categoryItems.slideDown();
				}

				if (collapsible.url) {
					// update the server. don't wait for a response
					$.post(collapsible.url, {
						category: $category.data('category-id'),
						state: $statusItem.hasClass(COLLAPSED_CLASS)
					});
				}
			});
		}

		return init;
	};

	var marketplace = icims.marketplace = icims.marketplace || {};
	marketplace.products = products();
})(icims || (icims = {}));

