// use jQuery as Sizzle so it doesn't break custom iCIMS components that use it.
var Sizzle = jQuery;

// execute custom icimsReady() function if defined
// this is an easy way to add simple per page javascript
// to certain pages right inline instead of having to create
// an entire js file for a couple lines of code.
$(document).ready(function () {
	if (window == window.top) {
		$('html').addClass('not-framed');
	} else {
		$('html').addClass('framed');

		// add an onblur event handler to the 'window' or 'iframe'
		// to collapse any open dropdowns when blurring on the current window/iframe
		// this fixes dropdowns inside of an iframe but not wrapping the iframe
		window.ontouchstart === undefined && $(window).on('blur', function () {
			// only toggle dropdowns that are actually open.
			$('.dropdown [aria-expanded="true"]').dropdown('toggle');
			$('ul:not(.reactVersion).actionDropdownMenu').removeClass('actionDropdownMenuOpen');
		});
	}

	// test for touch devices:
	// follow same classes as modernizr incase we decide
	// we want to use modernizr later on, we can just remove this.
	if (window.ontouchstart !== undefined && window.ontouchstart !== null) {
		$('html').addClass('touch');
	} else {
		$('html').addClass('no-touch');
	}

	icims.datetimepicker.init();
	icims.loaderoverlay.init();

	if (typeof window.icimsReady === 'function') {
		window.icimsReady();
	}
});


